import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ( {imageUrl, box} ) => {
	return (
	<div className='image-wrapper'>
	    <div className='absolute mt2'>
	      <img id='inputimage' alt='' src='https://i0.wp.com/cdn-prod.medicalnewstoday.com/content/images/articles/327/327492/a-woman-scratching-her-face-because-it-is-itchy.jpg?w=1155&h=1297' width='500px' height='auto'/>	    	
	      <div className='bounding-box'
		       style={{top: box.topRow, 
		        	   right: box.rightCol, 
		        	   bottom: box.bottomRow, 
		        	   left:box.leftCol}}>
	      </div>
	    </div>	  	
	  </div>
	);
}

export default FaceRecognition;
